    "Photomonitoring of Delmarva Fox Squirrel (Sciurus niger cinereus, DFS) on the
    Prime Hook National Wildlife Refuge during the summer of 2008.",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:56:18.751032",nt"name": "photomonitoring-of-delmarva-fox-squirrel-sciurus-niger-cinereus-dfs-on-the-prime-hook-nati",nt"isopen":
    false,nt"url": null,nt"notes": "The primary goal of this photomonitoring
    was to determine the status of the Prime Hook National Wildlife Refuge Delmarva
    Fox Squirrel population. The Photomonitor Survey Protocol was developed by the USFWS
    (United States Fish and Wildlife Service) Chesapeake Bay Field Office and is used
    to determine the presence or absence of DFS in sampled areas.  Delmarva Fox Squirrels
    were reintroduced at the Prime Hook Wildlife Refuge (PHNWR) in 1986. Twelve squirrels
    (6 females, 6 males) were released at PHNWR between May 1986 and September 1986.
    An additional six animals were obtained for a third release at PHNWR in May of 1987.
    The refuge contains more than 1500 acres of forested habitat of which about 300
    acres are characterized as Southern Red Oak Heath Forest. The squirrels may also
    use Mesic Coastal Plain Mixed Hardwood, Mesic Coastal Plain Oak and Mesic Rich Forest
    habitat types which account for an additional 400 acres of the refuge (see McAvoy
    , WA et al. 2007 for specific habitat-type descriptions found on the refuge). All
    photomonitoring effort in 2008 was confined to the primary habitat type: Southern
    Red Oak Heath Forest.",nt"license_title": "License Not Specified",nt"extras":
